import './App.css';
import Navbar from './Components/Navbar';
import ProfilePic from './Assets/profile_crop_2.png';

function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="makua">
        <div
          className="flex-center-h orange"
          style={{
            fontSize: '3em',
          }}
        >
          <strong>E Komo Mai</strong>
        </div>
        <div
          className="flex-center-h orange"
          style={{
            fontSize: '2em',
          }}
        >
          (Welcome)
        </div>
        <div className="profile flex-center-h">
          <img className="profpic" src={`${ProfilePic}`} height="500px" />
        </div>
        <div className="flex-center-h dark-blue light-bkgd">
          <p>My name is Derek Joshua Bal.</p>
        </div>
      </div>
    </div>
  );
}

export default App;
